import React, { Component } from 'react';

class Test extends Component {
  render() {
    return (
      <div>
        <h1>Layo Kaminski</h1>
        <p>Um cara que está contente com todas as coisas novas que está aprendendo diariamente</p>
      </div>
    )
  }
}

export default Test;
